insert  into `popularman`(`排名`,`姓名`,`国籍`,`出生日期`,`影响`,`图片链接`,`逝世日期`) values (1,'穆罕默德(محمد)','阿拉伯','571年','伊斯兰教先知，也是社会改革家、外交官、商人、哲学家、演说家、立法者、军事和政治领袖。公元七世纪于阿拉伯半岛传播伊斯兰教。中国的穆斯林普遍称之为“穆圣”。','http://upload.wikimedia.org/wikipedia/commons/thumb/e/eb/Calligraphic_representation_of_Muhammad%27s_name.jpg/100px-Calligraphic_representation_of_Muhammad%27s_name.jpg','632年'),(2,'艾萨克·牛顿(Isaac Newton)','英国','1643年1月4日','物理学家、数学家、天文学家、哲学家、炼金术士和基督教神学家。其万有引力定律和运动定律促成了牛顿力学的发展。对后来的物理研究有极大的影響力。','http://upload.wikimedia.org/wikipedia/commons/thumb/3/39/GodfreyKneller-IsaacNewton-1689.jpg/100px-GodfreyKneller-IsaacNewton-1689.jpg','1727年3月31日'),(3,'耶稣(Ἰησοῦς)','罗马帝国','约前4年','基督教的核心人物，被基督教徒认为是神上帝所賜下的獨生愛子。\n基督教是世界上信徒人數最多的宗教。','http://upload.wikimedia.org/wikipedia/commons/thumb/f/fb/Christ_Icon_Sinai_6th_century.jpg/100px-Christ_Icon_Sinai_6th_century.jpg','33年4月1日'),(4,'释迦牟尼(शाक्यमुनि)','古印度','前563年5月6日','古印度思想家，哲学家。佛教创始人，被尊称为佛陀。','http://upload.wikimedia.org/wikipedia/commons/thumb/8/8d/Buddha_meditating.jpg/100px-Buddha_meditating.jpg','前483年3月15日'),(5,'孔子(孔丘)','鲁国（中国东周春秋时期）','前551年9月28日','掌握中国的思想家，哲学家，儒家思想的创始人，哲学戒律强烈影响中国、韩国（韩国儒学）、日本（江户道学）、越南和印尼（印尼儒教）。','http://upload.wikimedia.org/wikipedia/commons/thumb/f/fb/Half_Portraits_of_the_Great_Sage_and_Virtuous_Men_of_Old_-_Confucius.jpg/100px-Half_Portraits_of_the_Great_Sage_and_Virtuous_Men_of_Old_-_Confucius.jpg','前479年4月11日'),(6,'保罗(Παῦλος)','罗马帝国','5年1月25日','基督教最杰出的一位使徒，他在巴勒斯坦和保罗书信中传讲基督教，这将是新约圣经不可分割的的一部分。','http://upload.wikimedia.org/wikipedia/commons/thumb/6/62/Rubens_apostel_paulus_grt.jpg/100px-Rubens_apostel_paulus_grt.jpg','67年6月29日'),(7,'蔡伦(蔡倫)','东汉（中国汉朝）','50年','被视为纸张和造纸术的最佳改良者。','http://upload.wikimedia.org/wikipedia/commons/thumb/6/6c/Cai_Lun_New.jpg/100px-Cai_Lun_New.jpg','121年'),(8,'约翰内斯·古腾堡(Johannes Gutenberg)','神圣罗马帝国','1398年','德国发明家，改良了印刷机。','http://upload.wikimedia.org/wikipedia/commons/thumb/e/e0/Anonymous_portrait_of_Johannes_Gutenberg_dated_1440%2C_Gutenberg_Museum.JPG/100px-Anonymous_portrait_of_Johannes_Gutenberg_dated_1440%2C_Gutenberg_Museum.JPG','1468年2月3日'),(9,'克里斯托弗·哥伦布(Cristoforo Colombo)','意大利','1451年10月31日','意大利航海家，和探险家。他的远航成功发现了新大陆。','http://upload.wikimedia.org/wikipedia/commons/thumb/c/c4/Possible_portrait_of_Christopher_Columbus.jpg/100px-Possible_portrait_of_Christopher_Columbus.jpg','1506年5月20日'),(10,'阿尔伯特·爱因斯坦(Albert Einstein)','德国','1879年3月14日','德国物理学家，因相对论和公式E=mc2而著名。','http://upload.wikimedia.org/wikipedia/commons/thumb/d/d3/Albert_Einstein_Head.jpg/100px-Albert_Einstein_Head.jpg','1955年4月18日'),(11,'路易·巴斯德  (Louis Pasteur)','法国','1822年12月27日','法国微生物学家、化学家。微生物学的奠基人之一，第一个创造狂犬病和炭疽的疫苗的科学家。被世人称颂为“进入科学王国的最完美无缺的人”。','http://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Louis_Pasteur_%281822_-_1895%29%2C_microbiologist_and_chemist_Wellcome_L0001835_%28cropped%29.jpg/100px-Louis_Pasteur_%281822_-_1895%29%2C_microbiologist_and_chemist_Wellcome_L0001835_%28cropped%29.jpg','1895年9月28日'),(12,'伽利略·伽利莱(Galileo Galilei)','意大利','1564年2月15日','意大利物理学家、数学家、天文学家、哲学家。改进望远镜、支持哥白尼的日心说。伽利略被譽為“現代觀測天文學之父”[2]、“現代物理學之父”[3]、“科學之父”[3]及“現代科學之父”。[4]','http://upload.wikimedia.org/wikipedia/commons/thumb/c/cc/Galileo.arp.300pix.jpg/100px-Galileo.arp.300pix.jpg','1642年1月8日'),(13,'亚里士多德','马其顿王国','前384年6月19日','古希腊哲学家，其留下的著作成为最完整而又最具影响力哲学系统之一，他单独创建了逻辑学、生物学、心理学，因此被誉为“最后一位精通所有知识的人”','http://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Aristotle_Altemps_Inv8575.jpg/100px-Aristotle_Altemps_Inv8575.jpg','前322年3月7日'),(14,'欧几里得','古希腊','前325年','古希腊数学家，其著作《几何原本》是欧洲数学的基础，被称为“几何之父”。','http://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Artgate_Fondazione_Cariplo_-_Cifrondi_Antonio%2C_Euclide.jpg/100px-Artgate_Fondazione_Cariplo_-_Cifrondi_Antonio%2C_Euclide.jpg','前265年'),(15,'摩西   (מֹשֶׁה‎）','以色列','前1391年','犹太教的创始者，是犹太教、基督教里重要的先知。《十诫》的执笔者。','http://upload.wikimedia.org/wikipedia/commons/thumb/b/b7/Ten_Commandments_by_A.Losenko_%28%3F%29.jpg/100px-Ten_Commandments_by_A.Losenko_%28%3F%29.jpg','前1271年9月4日'),(16,'查尔斯·达尔文','英国','1809年2月12日','英国博物学家、生物学家。其著作《物种起源》成为现代演化思想的基础，是现今生物学的基石。','http://upload.wikimedia.org/wikipedia/commons/thumb/3/3c/Charles_Darwin_01.jpg/100px-Charles_Darwin_01.jpg','1882年4月19日'),(17,'嬴政\n(秦始皇)','秦国（中国）','前260年2月7日','中国历史上第一个采用君主专制制度，也是第一个使用皇帝称号的君主。推行多项政策（郡县制、书同文、度量衡），奠定了中国两千多年政治制度基本格局。','http://upload.wikimedia.org/wikipedia/commons/thumb/2/27/Qinshihuang.jpg/100px-Qinshihuang.jpg','前210年8月10日'),(18,'盖乌斯·图里努斯·屋大维','罗马帝国','前63年9月23日','罗马帝国的开国君主，统治罗马长达43年。建立专制的元首政治，开创了罗马帝国，被认为是最伟大的罗马皇帝之一。','http://upload.wikimedia.org/wikipedia/commons/thumb/f/f4/Statue_of_August_from_Prima_Porta._Detail._Rome%2C_Vatican_Museums%2C_Chiaramonti_Museum%2C_New_wing._%284285799787%29.jpg/100px-Statue_of_August_from_Prima_Porta._Detail._Rome%2C_Vatican_Museums%2C_Chiaramonti_Museum%2C_New_wing._%284285799787%29.jpg','14年8月19日'),(19,'尼古拉·哥白尼','波兰王国','1473年2月19日','文艺复兴时期波兰数学家、天文学家，提倡日心说模型。其发表的《天体运行论》一般被认为是现代天文学的起步点。','http://upload.wikimedia.org/wikipedia/commons/thumb/f/f2/Nikolaus_Kopernikus.jpg/100px-Nikolaus_Kopernikus.jpg','1543年5月24日'),(20,'安托万-洛朗·德·拉瓦锡','法国','1743年8月26日','法国贵族，著名化学家、生物学家。他使得化学从定性转为定量，给出了氢和氧的命名，被后世尊称为“近代化学之父”。','http://upload.wikimedia.org/wikipedia/commons/thumb/7/78/Antoine_laurent_lavoisier.jpg/100px-Antoine_laurent_lavoisier.jpg','1794年5月8日'),(21,'君士坦丁大帝','罗马帝国','274年2月27日','頒佈《米蘭詔書》，承認在帝國內部有信仰基督教的自由，令基督教合法化','http://upload.wikimedia.org/wikipedia/commons/thumb/c/c2/Head_of_Colossus_of_Constantine%2C_Aug_24_2021.jpg/100px-Head_of_Colossus_of_Constantine%2C_Aug_24_2021.jpg','337年5月22日'),(22,'詹姆斯·瓦特','英国','1736年1月19日','改良了蒸汽機','http://upload.wikimedia.org/wikipedia/commons/thumb/8/8e/James_Watt_%281736%E2%80%931819%29.jpg/100px-James_Watt_%281736%E2%80%931819%29.jpg','1819年8月19日'),(23,'迈克尔·法拉第','英国','1791年9月22日','在電磁學及電化學領域做出很多重要貢獻，其中主要的貢獻為電磁感應、抗磁性、電解','http://upload.wikimedia.org/wikipedia/commons/thumb/d/d5/Michael_Faraday_Millikan-Gale-1906.jpg/100px-Michael_Faraday_Millikan-Gale-1906.jpg','1867年8月25日'),(24,'詹姆斯·克拉克·麦克斯韦','英国','1831年6月13日','提出了將電、磁、光統歸為電磁場中現象的麥克斯韋方程組','http://upload.wikimedia.org/wikipedia/commons/thumb/b/b0/James-Clerk-Maxwell-1831-1879.jpg/100px-James-Clerk-Maxwell-1831-1879.jpg','1879年11月5日'),(25,'馬丁·路德','德国','1483年11月10日','推動了天主教的宗教改革，令天主教分裂成舊教（天主教）和新教（基督教）','http://upload.wikimedia.org/wikipedia/commons/thumb/9/9a/Martin_Luther_by_Cranach-restoration.tif/lossy-page1-100px-Martin_Luther_by_Cranach-restoration.tif.jpg','1546年2月18日'),(26,'乔治·华盛顿','美国','1732年2月22日','第一任美國總統，美國國父，於美國獨立戰爭帶領大陸軍打敗了英國','http://upload.wikimedia.org/wikipedia/commons/thumb/2/2e/George-Washington.jpg/100px-George-Washington.jpg','1799年12月14日'),(27,'卡爾·馬克思','德国','1818年5月5日','寫了《資本論》，《共產黨宣言》，社會主義者，共產主義提出者之一','http://upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Karl_Marx.jpg/100px-Karl_Marx.jpg','1883年3月14日'),(28,'萊特兄弟','美国','威爾伯·萊特：1867年4月16日 奧維爾·萊特：1871年8月19日','實現了人類史上首次重於空氣的航空器持續而且受控的動力飛行','http://upload.wikimedia.org/wikipedia/commons/thumb/3/38/Wilbur_Wright-crop.jpg/100px-Wilbur_Wright-crop.jpg','威爾伯·萊特：1912年5月30日 奧維爾·萊特：1948年1月30日'),(29,'成吉思汗','蒙古帝国','1162年5月31日','建立一個橫跨歐亞的帝國','http://upload.wikimedia.org/wikipedia/commons/thumb/3/35/YuanEmperorAlbumGenghisPortrait.jpg/100px-YuanEmperorAlbumGenghisPortrait.jpg','1227年8月25日'),(30,'亚当·斯密','英国','1723年6月5日','發展出了現代的經濟學學科，也提供了現代自由貿易、資本主義和自由意志主義的理論基礎。','http://upload.wikimedia.org/wikipedia/commons/thumb/1/18/37.Adam_Smith.jpg/100px-37.Adam_Smith.jpg','1790年7月17日'),(31,'威廉·莎士比亚','英格兰','1564年4月26日','是英國文學史上最傑出的戲劇家，也是西方文藝史上最傑出的作家之一，全世界最卓越的文學家之一。','http://upload.wikimedia.org/wikipedia/commons/thumb/a/a2/Shakespeare.jpg/100px-Shakespeare.jpg','1616年5月3日'),(32,'约翰·道尔顿','英国','1766年9月6日','近代原子理論的提出者，對色盲亦有研究。','http://upload.wikimedia.org/wikipedia/commons/thumb/0/00/John_Dalton_by_Thomas_Phillips%2C_1835.jpg/100px-John_Dalton_by_Thomas_Phillips%2C_1835.jpg','1844年7月27日'),(33,'亚历山大大帝','马其顿王国','前356年7月20日','創立歷史上最大的帝國之一，被認為是歷史上最成功的軍事統帥之一。','http://upload.wikimedia.org/wikipedia/commons/thumb/a/a0/Marble_portrait_of_Alexander_the_Great%2C_Hellenistic_Greek%2C_2nd-1st_century_BC%2C_said_to_be_from_Alexandria%2C_Egypt%2C_British_Museum_%2813738844563%29.jpg/100px-Marble_portrait_of_Alexander_the_Great%2C_Hellenistic_Greek%2C_2nd-1st_century_BC%2C_said_to_be_from_Alexandria%2C_Egypt%2C_British_Museum_%2813738844563%29.jpg','前323年6月10日'),(34,'拿破仑一世','法国','1769年8月15日','帶領大革命後的法國對抗由歐洲各國所組成的反法聯盟，並屢次獲勝','http://upload.wikimedia.org/wikipedia/commons/thumb/5/51/Napoleon_cropFXD.jpg/100px-Napoleon_cropFXD.jpg','1821年5月5日'),(35,'托马斯·爱迪生','美国','1847年2月11日','擁有眾多重要的發明專利，是世界上第一個使用大量生產原則和其工業研究實驗室來進行發明創造的人。','http://upload.wikimedia.org/wikipedia/commons/thumb/0/00/Portrait_of_Thomas_Edison_in_the_Building_5_Library_of_his_West_Orange_Laboratory._%288358422b0fa5422cbb865f832b7f990c%29.jpg/100px-Portrait_of_Thomas_Edison_in_the_Building_5_Library_of_his_West_Orange_Laboratory._%288358422b0fa5422cbb865f832b7f990c%29.jpg','1931年10月18日'),(36,'安東尼·范·列文虎克','荷兰','1632年10月24日','有光學顯微鏡與微生物學之父的稱號，改進了顯微鏡以及建立微生物學。','http://upload.wikimedia.org/wikipedia/commons/thumb/9/94/Jan_Verkolje_-_Antonie_van_Leeuwenhoek.jpg/100px-Jan_Verkolje_-_Antonie_van_Leeuwenhoek.jpg','1723年8月26日'),(37,'威廉·莫顿','美国','1819年8月8日','現代麻醉學創始人之一。','http://upload.wikimedia.org/wikipedia/commons/thumb/6/6f/WilliamMorton.jpg/100px-WilliamMorton.jpg','1868年7月15日'),(38,'古列尔莫·马可尼','意大利','1874年4月25日','從事無線電設備的研製和改進，發現高頻波。','http://upload.wikimedia.org/wikipedia/commons/thumb/0/0d/Guglielmo_Marconi.jpg/100px-Guglielmo_Marconi.jpg','1937年7月20日'),(39,'阿道夫·希特勒','纳粹德国','1889年4月20日','德國政治人物，納粹黨領袖，為納粹大屠殺的主要發動者之一。','http://upload.wikimedia.org/wikipedia/commons/thumb/e/ee/Adolf_Hitler_Berghof-1936.jpg/100px-Adolf_Hitler_Berghof-1936.jpg','1945年4月30日'),(40,'柏拉图','古希腊','前427年5月21日','是著名的古希臘哲學家，\n「西方三聖賢」及「希臘三哲」之一。','http://upload.wikimedia.org/wikipedia/commons/thumb/d/da/Plato_Pio-Clemetino_Inv305.jpg/100px-Plato_Pio-Clemetino_Inv305.jpg','前347年'),(41,'奥利弗·克伦威尔','英格兰','1599年4月25日','廢除英格蘭的君主制，並征服蘇格蘭、愛爾蘭，出任英蘇愛聯邦之護國公','http://upload.wikimedia.org/wikipedia/commons/thumb/2/24/Oliver_Cromwell_by_Samuel_Cooper.jpg/100px-Oliver_Cromwell_by_Samuel_Cooper.jpg','1658年9月3日'),(42,'亚历山大·格拉汉姆·贝尔','加拿大、美国'