程循環內燃機。為汽車的誕生產生了推動作用。','http://upload.wikimedia.org/wikipedia/commons/thumb/d/df/Nicolaus-August-Otto.jpg/100px-Nicolaus-August-Otto.jpg','1891年1月28日'),(62,'弗朗西斯科·皮萨罗','西班牙','1478年3月16日','西班牙早期殖民者，開啟了西班牙征服南美洲的時代，也是現代秘魯首都利瑪的建立者。','http://upload.wikimedia.org/wikipedia/commons/thumb/e/ed/Portrait_of_Francisco_Pizarro_%28cropped%29.png/100px-Portrait_of_Francisco_Pizarro_%28cropped%29.png','1541年6月26日'),(63,'荷南·科尔蒂斯','西班牙','1485年','西班牙殖民者，以摧毀阿茲特克古文明、在墨西哥建立殖民地而聞名。','http://upload.wikimedia.org/wikipedia/commons/thumb/0/06/Retrato_de_Hern%C3%A1n_Cort%C3%A9s.jpg/100px-Retrato_de_Hern%C3%A1n_Cort%C3%A9s.jpg','1547年12月2日'),(64,'托马斯·杰斐逊','美国','1743年4月13日','美利堅合眾國第三任總統，同時也是《美國獨立宣言》主要起草人','http://upload.wikimedia.org/wikipedia/commons/thumb/1/1e/Thomas_Jefferson_by_Rembrandt_Peale%2C_1800.jpg/100px-Thomas_Jefferson_by_Rembrandt_Peale%2C_1800.jpg','1826年7月4日'),(65,'伊莎贝拉一世','西班牙','1451年4月22日','完成了收復失地運動，為統一西班牙奠定了基礎。','http://upload.wikimedia.org/wikipedia/commons/thumb/8/83/IsabellaofCastile03.jpg/100px-IsabellaofCastile03.jpg','1504年11月26日'),(66,'斯大林','苏联','1878年12月18日','蘇聯領導人，帶領蘇聯成為軍事及工業大國','http://upload.wikimedia.org/wikipedia/commons/thumb/7/7e/Joseph_Stalin%2C_1950_%28cropped%29.jpg/100px-Joseph_Stalin%2C_1950_%28cropped%29.jpg','1953年3月5日'),(67,'盖乌斯·儒略·恺撒','罗马共和国','前100年7月13日','羅馬帝國的奠基者，被一些歷史學家視為羅馬帝國的無冕之皇，有凱撒大帝之稱。','http://upload.wikimedia.org/wikipedia/commons/thumb/6/62/Retrato_de_Julio_C%C3%A9sar_%2826724093101%29_%28cropped%29.jpg/100px-Retrato_de_Julio_C%C3%A9sar_%2826724093101%29_%28cropped%29.jpg','前44年3月15日'),(68,'征服者威廉','英格兰','1028年11月8日','領導諾曼人攻打英格蘭， 成為第一位諾曼英格蘭君主','http://upload.wikimedia.org/wikipedia/commons/thumb/d/d4/William_1_of_England.jpg/100px-William_1_of_England.jpg','1087年9月9日'),(69,'西格蒙德·弗洛伊德','奥地利帝国','1856年5月6日','被譽為「精神分析之父」，提出潛意識、自我、心理防衛機制等概念。二十世紀最偉大的心理學家之一。','http://upload.wikimedia.org/wikipedia/commons/thumb/d/dc/Sigmund_Freud%2C_by_Max_Halberstadt_%28cropped2%29.jpg/100px-Sigmund_Freud%2C_by_Max_Halberstadt_%28cropped2%29.jpg','1939年9月23日'),(70,'爱德华·詹纳','英国','1749年5月17日','以研究及推廣牛痘疫苗，防止天花而聞名，被稱為疫苗之父。','http://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Edward_Jenner.jpg/100px-Edward_Jenner.jpg','1823年1月26日'),(71,'威廉·伦琴','德国','1845年3月27日','德國物理學家，發現X射線。','http://upload.wikimedia.org/wikipedia/commons/thumb/8/87/ETH-BIB-R%C3%B6ntgen%2C_Wilhelm_Conrad_%281845-1923%29-Portrait-Portr_04693.tif/lossy-page1-100px-ETH-BIB-R%C3%B6ntgen%2C_Wilhelm_Conrad_%281845-1923%29-Portrait-Portr_04693.tif.jpg','1923年2月10日'),(72,'约翰·塞巴斯蒂安·巴赫','神圣罗马帝国','1685年3月31日','巴哈被認為是音樂史上最重要的作曲家之一，被稱呼為音樂之父。','http://upload.wikimedia.org/wikipedia/commons/thumb/5/5e/Johann_Sebastian_Bach.png/100px-Johann_Sebastian_Bach.png','1750年7月28日'),(73,'李耳','楚国（中国东周春秋时期）','前571年','李聃為道家始祖、東方三大聖人之首，主張無為而治、天人合一、清靜無為的統治理念，著有《道德經》。','http://upload.wikimedia.org/wikipedia/commons/thumb/d/d9/LaoGod.jpg/100px-LaoGod.jpg','前471年'),(74,'弗朗索瓦－玛利‧阿鲁埃','法国','1694年11月21日','法國啟蒙時代思想家、哲學家、文學家，啟蒙運動公認的領袖和導師。 被稱為「法蘭西思想之父」','http://upload.wikimedia.org/wikipedia/commons/thumb/f/f2/Atelier_de_Nicolas_de_Largilli%C3%A8re%2C_portrait_de_Voltaire%2C_d%C3%A9tail_%28mus%C3%A9e_Carnavalet%29_-002.jpg/100px-Atelier_de_Nicolas_de_Largilli%C3%A8re%2C_portrait_de_Voltaire%2C_d%C3%A9tail_%28mus%C3%A9e_Carnavalet%29_-002.jpg','1778年5月30日'),(75,'约翰内斯·开普勒','德國','1571年12月27日','德國天文學家、數學家，是十七世紀科學革命的關鍵人物。他最為人知的成就為克卜勒定律，啟發牛頓後來想出牛頓萬有引力定律。','http://upload.wikimedia.org/wikipedia/commons/thumb/a/a9/Portrait_Confused_With_Johannes_Kepler_1610.jpg/100px-Portrait_Confused_With_Johannes_Kepler_1610.jpg','1630年11月15日'),(76,'恩里科·费米','意大利','1901年9月29日','一位美籍意大利裔物理學家。他對量子力學、核物理、粒子物理以及統計力學都做出了傑出貢獻，他還是原子彈的設計師和締造者之一。','http://upload.wikimedia.org/wikipedia/commons/thumb/3/3c/Enrico_Fermi.jpg/100px-Enrico_Fermi.jpg','1954年11月28日'),(77,'莱昂哈德·欧拉','瑞士','1707年4月15日','一位瑞士數學家和物理學家，近代數學先驅之一。在微積分和圖論的領域都有重大發現。','http://upload.wikimedia.org/wikipedia/commons/thumb/d/d7/Leonhard_Euler.jpg/100px-Leonhard_Euler.jpg','1783年9月18日'),(78,'让-雅克·卢梭','法国','1712年6月28日','所論述的人民主權及民主政治哲學思想的深遠影響可見於近代的啟蒙運動、法國大革命以至現代的政治、哲學還有教育思想','http://upload.wikimedia.org/wikipedia/commons/thumb/b/b7/Jean-Jacques_Rousseau_%28painted_portrait%29.jpg/100px-Jean-Jacques_Rousseau_%28painted_portrait%29.jpg','1778年7月2日'),(79,'尼可罗·马基亚维利','意大利','1469年5月3日','所著的《君主論》一書提出了現實主義的政治理論，另一著作《論李維》則提及了共和主義理論','http://upload.wikimedia.org/wikipedia/commons/thumb/2/27/Santi_di_Tito_-_Niccolo_Machiavelli%27s_portrait_headcrop.jpg/100px-Santi_di_Tito_-_Niccolo_Machiavelli%27s_portrait_headcrop.jpg','1527年6月21日'),(80,'托马斯·罗伯特·马尔萨斯','英国','1766年2月13日','英國人口學家和政治經濟學家。他的《人口學原理》影響深遠。','http://upload.wikimedia.org/wikipedia/commons/thumb/3/32/Thomas_Robert_Malthus.jpg/100px-Thomas_Robert_Malthus.jpg','1834年12月23日'),(81,'约翰·肯尼迪','美国','1917年5月29日','美國第35任總統，是美國頗具影響力的肯尼迪政治家族成員，被視為美國自由派的代表。','http://upload.wikimedia.org/wikipedia/commons/thumb/c/c3/John_F._Kennedy%2C_White_House_color_photo_portrait.jpg/100px-John_F._Kennedy%2C_White_House_color_photo_portrait.jpg','1963年11月22日'),(82,'格雷戈里·平卡斯','美国','1903年4月9日','美國生物學家，避孕藥發明者之一。','无','1967年8月22日'),(83,'摩尼 (ܡܐܢܝ ܚܝܐ)','波斯','216年4月14日','创立摩尼教。','http://upload.wikimedia.org/wikipedia/commons/thumb/6/63/Mani.jpg/100px-Mani.jpg','274年2月26日'),(84,'列寧 (Влади́мир Ильи́ч Ле́нин)','蘇聯','1870年4月22日','帶領無產階級工人建立蘇維埃俄國。','http://upload.wikimedia.org/wikipedia/commons/thumb/c/c0/Lenin_in_1920_%28cropped%29.jpg/100px-Lenin_in_1920_%28cropped%29.jpg','1924年1月21日'),(85,'杨坚','隋朝（中国）','541年7月21日','结束南北朝，统一中国，建立三省六部制、科举制。','http://upload.wikimedia.org/wikipedia/commons/thumb/a/ad/Sui_Wendi_Tang.jpg/100px-Sui_Wendi_Tang.jpg','604年8月13日'),(86,'瓦斯科·达伽马(Vasco da Gama)','葡萄牙','1469年9月3日','葡萄牙探險家，他是歷史上第一位從歐洲航海到印度的人。','http://upload.wikimedia.org/wikipedia/commons/thumb/8/8d/Vasco_da_Gama_-_1838.png/100px-Vasco_da_Gama_-_1838.png','1524年12月24日'),(87,'居鲁士大帝','波斯','前600年','建立波斯帝国。','http://upload.wikimedia.org/wikipedia/commons/thumb/5/55/Olympic_Park_Cyrus-2.png/100px-Olympic_Park_Cyrus-2.png','前530年12月4日'),(88,'彼得大帝','俄羅斯帝國','1672年5月30日','在位期間力行改革，使俄羅斯現代化。','http://upload.wikimedia.org/wikipedia/commons/thumb/7/72/Peter_der-Grosse_1838.jpg/100px-Peter_der-Grosse_1838.jpg','1725年2月8日'),(89,'毛澤東','中華人民共和國','1893年12月26日','國共內戰推翻中國國民黨在中國大陸的統治','http://upload.wikimedia.org/wikipedia/commons/thumb/5/55/Mao_Zedong_1959_%28cropped%29.jpg/100px-Mao_Zedong_1959_%28cropped%29.jpg','1976年9月9日'),(90,'弗兰西斯·培根','英格兰','1561年1月22日','著名英國哲學家、政治家、科學家、法學家、演說家和散文作家，是古典經驗論的始祖。','http://upload.wikimedia.org/wikipedia/commons/thumb/1/11/Francis_Bacon%2C_Viscount_St_Alban_from_NPG_%282%29.jpg/100px-Francis_Bacon%2C_Viscount_St_Alban_from_NPG_%282%29.jpg','1626年4月9日'),(91,'亨利·福特','美國','1863年7月30日','亨利·福特是世界上第一位將裝配線概念實際應用在工廠並大量生產而獲得巨大成功者。他讓汽車在美國真正普及化。','http://upload.wikimedia.org/wikipedia/commons/thumb/d/d9/Henry_ford_1919_%28cropped%29.jpg/100px-Henry_ford_1919_%28cropped%29.jpg','1947年4月7日'),(92,'孟轲','邹国（中国东周战国时期）','前372年','繼承並發揚孔子的思想，有「亞聖」之尊稱。孟子與其門人著有《孟子》一書。','http://upload.wikimedia.org/wikipedia/commons/thumb/7/7d/Half_Portraits_of_the_Great_Sage_and_Virtuous_Men_of_Old_-_Meng_Ke_%28%E5%AD%9F%E8%BB%BB%29.jpg/100px-Half_Portraits_of_the_Great_Sage_and_Virtuous_Men_of_Old_-_Meng_Ke_%28%E5%AD%9F%E8%BB%BB%29.jpg','前289年'),(93,'琐罗亚斯德','米底王国','前628年','瑣羅亞斯德教創始人。','http://upload.wikimedia.org/wikipedia/commons/thumb/9/9b/CIMRM_44-Mithraic_pater_%28Dura_Europos%29_B.jpg/100px-CIMRM_44-Mithraic_pater_%28Dura_Europos%29_B.jpg','前551年'),(94,'伊丽莎白一世','英格兰','1533年9月7日','建立新教的英格蘭教會，她成為該教會最高領袖，實施宗教和解。','http://upload.wikimedia.org/wikipedia/commons/thumb/7/7b/Elizabeth_I_Darnley_Portrait_v3.jpg/100px-Elizabeth_I_Darnley_Portrait_v3.jpg','1603年3月24日'),(95,'米哈伊爾·謝爾蓋耶維奇·戈巴契夫','俄羅斯','1931年3月2日','蘇聯第一位总统， 希望維持蘇聯的統一性，並建立民主共和国的蘇聯（苏维埃主权共和国联盟）。','http://upload.wikimedia.org/wikipedia/commons/thumb/c/c8/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%93%D0%BE%D1%80%D0%B1%D0%B0%D1%87%D1%91%D0%B2_%2803-12-1989%29_%28cropped%29.png/100px-%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%93%D0%BE%D1%80%D0%B1%D0%B0%D1%87%D1%91%D0%B2_%2803-12-1989%29_%28cropped%29.png','2022年8月30日'),(96,'美尼斯','埃及','约前3200年','於公元前3100年前創立了古埃及第一王朝，被視